import PropTypes from 'prop-types'

const Buttons = ({color, text, onClick}) => {


    return (
        <button
        className="btn"
        onClick = {onClick} 
        style={{backgroundColor: color}}>
            {text}
        </button> 
    )
}

Buttons.defaultProps = {
    color: 'steelblue'
}

Buttons.propTypes = {
    text: PropTypes.string,
    color: PropTypes.string,
    onClick: PropTypes
}
export default Buttons
